import css from './ConvertFrom.module.css';

export const ConvertFrom = ({
  value,
  currency,
  onChangeFromValue,
  onChangeToValue,
  onChangeCurrency,
}) => {
  return (
    <>
      <li className={css.exchange}>
        <label>
          Отдаёте:
          <input
            className={css.exchange__input__give}
            placeholder=""
            value={value}
            onChange={e => onChangeFromValue(e.target.value)}
            type="number"
          />
        </label>
      </li>
      <li className={css.exchange}>
        <label>
          Получаете:
          <input
            className={css.exchange__input__get}
            placeholder=""
            value={value}
            onChange={e => onChangeToValue(e.target.value)}
            type="number"
          />
        </label>
      </li>
      <li>
        <button className={css.exchange__button} type="button">
          СОЗДАТЬ ЗАЯВКУ НА ОБМЕН
        </button>
      </li>
    </>
  );
};
export default ConvertFrom;
